import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import ImagesPage from "./pages/ImagesPage";
import ImageToTextPage from "./pages/ImageToTextPage";
import TextToImagePage from "./pages/TextToImagePage";
import "./App.css";

function App() {
  return (
    <Router>
      <header className="app-header">
        <h1>VQA Dashboard</h1>
        <nav>
          <Link to="/images">Images</Link>
          <Link to="/image-to-text">Image to Text</Link>
          <Link to="/text-to-image">Text to Image</Link>
        </nav>
      </header>
      <main>
        <Routes>
          <Route path="/images" element={<ImagesPage />} />
          <Route path="/images/:imageId" element={<ImagesPage />} />
          <Route path="/image-to-text" element={<ImageToTextPage />} />
          <Route path="/text-to-image" element={<TextToImagePage />} />
          <Route path="*" element={<ImagesPage />} />
        </Routes>
      </main>
    </Router>
  );
}

export default App;

